		"TBAppDescription": "For the first time ever, Wrestling Revolution features BOTH aspects of the business in ONE shared universe - and this special \"Pro\" edition offers full access to each career with no holds barred! Start anywhere with anyone, and either take shots in the ring as a wrestler or call the shots backstage as a booker - promoting entertaining matches every week for ratings. Seeing each side of the curtain gives you an even better appreciation for the other, and ensures you'll never grow bored of wrestling again!\r\n\r\nYour purchase also includes a \"Backstage Pass\" that allows you to save your changes to all 9 rosters before pitting them against each other in dream matches of your own creation! With 4 pages of rules to mix & match - including up to 20 wrestlers in rings of any shape or size - the only limit is your imagination. You can also blow off steam with no pressure by revisiting the 8 weeks of shows from the game's promotional tour. Not to mention the interactive training process that teaches you how to lock up in the first place.\r\n\r\nBASIC CONTROLS\r\nThe game features an interactive tutorial that you are advised to play through, but the basic controls are as follows:\r\nCURSORS = Movement (double-tap to dash)\r\nA = Attack (with a direction to aim high, without to aim low)\r\nG = Grapple\r\nR = Run\r\nP = Pick-Up \/ Drop (with a direction to throw)\r\nT = Taunt \/ Pin \/ Referee duties\r\nEYE = Change focus \/ Turn opponent around\r\nHEALTH METER = Switch character\r\nCLOCK = Pause \/ Change camera angle\r\n\r\nPERFORMANCE\r\nAlthough every effort has been made to keep performance as high as possible, some devices may benefit from a visit to the Options menu to fine tune the display:\r\n- The number of characters is perhaps the biggest factor so consider turning off referees and setting a limit on the match size.\r\n- If you don't want to sacrifice numbers, you can sacrifice polygons instead and opt for \"Basic\" character models (no fingers).\r\n- The ropes are surprisingly demanding and you may squeeze in an extra character if you make them \"Static\".\r\n- Turning off shadows and reducing crowd sprites may also help.",
