		"TBAppDescription": "Fly and survive through the Game of the Year -winning action adventure BADLAND.\r\n5\/5 - AppSmile - \"A standout game\"\r\n4\/4 - Slide to Play - \"A must-download\"\r\n5\/5 - AppSpy - \"An absolute treat to play\"\r\n5\/5 - Apple\u00e2\u20ac\u2122N'Apps - \"One of the best games\"\r\n9\/10 - Destructoid - \"A hallmark of excellence\"\r\n4.5\/5 - TouchArcade - \"Easy to recommend\"\r\n\r\nBADLAND is an award-winning atmospheric side-scrolling action adventure platformer set in a gorgeous forest full of various inhabitants, trees and flowers. Although the forest appears to be right out of a beautiful fairy tale, there\u00e2\u20ac\u2122s something terribly wrong. The player controls one of the forest dwellers to find out what\u00e2\u20ac\u2122s going on, and discovers an astonishing number of imaginative traps and obstacles on the way.\r\n\r\nBADLAND takes side-scrollers to the next level with its innovative physics-based gameplay combined with stunning, atmospheric graphics and audio.\r\n\r\nBADLAND also features a highly original local multiplayer mode for up to four players on the same device, where the name of the game is survival of the fittest with no rules. It\u00e2\u20ac\u2122s totally OK to push your rivals in front of spinning circular saws to survive. Or, if that's too rough for you, you can also cooperate with your friends and play the modified single player campaign with up to four players.",
