		"TBAppDescription": "Rocket Riot is an action-packed side-view shooter featuring a bazooka-wielding jetpack soldier. Players blast their way through the environment against computer-controlled enemies in an effort to defeat the nasty pirate Blockbeard. \r\nBazookas, Jetpacks, Pirates\u2026what\u2019s not to love?\r\n\r\nPress Quotes:\r\n\"Rocket Riot is a blast to play (quite literally\" \u2014 Touch Arcade, 4\/5\r\n\r\n\"Rocket Riot is undoubtedly the best side scroller to come out of the iPhone game scene as of yet.\" \u2014 TapScape\r\n\r\n\"The action is fast and fun, the power-ups are a joy to use...and the destructible environments give the game a unique feel.\" \u2014 Slide To Play, 3\/4\r\n\r\n\u2022 ROCKET & ROLL\r\nUse the flawless touch controls to navigate through a completely destructible environment, uncover special power-ups or even burrow into different areas of the map using your bazooka as a makeshift shovel. \r\n\r\n\u2022 HAVE A BLAST\r\n48 level campaign featuring everything from zombies to rocket propelled pirates! Destroy enemies in-game to unlock over 100 playable characters. Defeat giant bosses from gangs of killer bananas (seriously), to Blockbeard himself!\r\n\r\n\u2022 FUN WITH ROCKETS\r\nDestroy everything in sight with your trusty rocket launcher. Collect twenty different power-ups and power-downs from bouncing rockets to multi-missiles to ghost mode and more!\r\n\r\n\u2022KILLER LOOK AND FEEL\r\nGo retro with the incredible 8-bit stylized visuals of Rocket Riot. Try three different, yet equally refined control options and find which one suits you best.\r\n\r\n\u2022 UNIVERSAL SUPPORT\r\nLocalized for French, Italian, Spanish and German and will work on iPhone, iPod touch and iPad. \r\n\r\n\u2022 FLING JOYSTICK SUPPORT\r\nRocket Riot supports the very cool Fling Joystick from Ten One Design. Yeah!",
