		"TBAppDescription": "The absolute cuddle alarm for your iPad or iPhone: Tivola brings the next installment of its 3D animal game series with DogWorld 3D\u2019s cute Dalmatian, Labrador, Shepherd, Rottweiler and Beagle puppies. You\u2019ll have little, faithful companions by your side to share all kinds of crazy adventures with.\r\n\r\n\r\nUNENDING GAME FUN \r\n\r\nThe little puppies are always with you and are always delighted when you take care of them, give them treats, or just simply cuddle them. Each puppy reacts to your touch, and you will be amazed by the incredibly adorable animations in amazing 3D graphics. With your finger, you can nudge your new friend slowly out of his dreams so that he happily jumps on the screen or begs on command with a wagging tail. While doing this he is always ready to cuddle or play and he's always in an intoxicatingly good mood. It only takes one look in his faithful little button eyes for you to fall under his spell and to give him attention, which he adores.\r\n\r\n\r\nCLUMSY DANCING\r\n\r\nYou thought that you can't really rock out with dogs? You thought wrong: Pump up the stereo system together with your little Dalmatian, Labrador, and Beagle, and you can marvel at their clumsy dance moves. Depending on the mood, you can choose from different songs and decide which funny moves the puppies perform to the rhythm. A good mood is guaranteed!\r\n\r\n\r\nFUNNY CLOTHING\r\n\r\nThe little puppies love it when you search for funny accessories in the wardrobe room so that you can dress them up. Hats, shoes, bows and other things are ready so that you can get started with costuming right away. Your fantasies have no limits; decorate your darling according to your imagination. If you are happy with the result, then you can create a photographic memory of the experience. Let your dog pose for the camera and create unforgettable snapshots.\r\n\r\n\r\nCOLLECT STARS TO ENSURE THAT YOU RECEIVE SURPRISES\r\n\r\nYou collect stars with every mission. Once you've reached a certain amount, a cool surprise waits for you each time. Cool dog accessories such as treats and toys are hidden in the gift packets for unending game fun with your new friend.\r\n\r\nPlay DogWorld 3D now and care for your own cute puppy dogs!\r\n\r\nTivola\u2019s premium games offer players endless gaming fun with their favorite animals, without any in-app purchases, annoying ads, or external links. This is why premium games are perfectly suited for even our littlest animal fans. For a set price, you can get all the content and all the objects in the game from the start \u2013 just waiting to be played with! What are you waiting for? Let\u2019s start playing!\r\n",
