		"TBAppDescription": "Walk Titanic's decks! Here you are on-board the RMS Titanic (April 14th, 1912) and can stroll her decks!\r\n\r\nWhat better way to learn about the RMS Titanic, than by virtually walking her decks. \r\n\r\nWonder what was it like to look up at her funnels, to hear her whistles, to look down from the crow's nest? You can find out in this app!\r\n\r\nLearn as you walk, like never before!\r\n\r\nClick icons as you walk around, revealing famous images and detailed descriptions about the very location you are at. It's easier than ever to place Titanic photographs, by being there where they were taken.\r\n\r\nGo from the Forecastle to the Poop Deck, or go for a walk along the A Deck, B Deck and Well Deck exterior spaces. As you reach key points you'll have icons to click that show more information, images and deck plans.\r\n\r\nYou'll find out what it felt like to be on Titanic, by being there.\r\n\r\nSet to period music, this app lovingly recreates the famous liner on her last day afloat.\r\n\r\nThe app is packed with lots of information - pull up images in the actual locations they were taken, read information about those locations and additionally view glorious deck plans (courtesy Titanic historian Bruce Beveridge) - you'll understand Titanic's decks and the context of photos and history interactively.\r\n\r\nYou can walk up to any lifeboat, read about who was in it, and much more.\r\n\r\n(This comprehensive guide is for Titanic's outer decks, the interior and sinking is currently beyond the intended scope, but may follow)\r\n\r\nSee, hear and feel what it was like to be on the RMS Titanic!\r\n\r\nAs with all 3d intensive apps and software, a newer device recommended (app may not run on older devices)",
