		"TBAppDescription": "Enter a twisted world of illusions and start seeing in a way you never had before. Logic Path is a calm, relaxing puzzle game that will change your perception of the world forever. Experience a calming journey through 140 exciting levels!\r\n\r\nFEATURES:\r\n- Innovative, perspective based gameplay\r\n- 140 constantly surprising levels to solve\r\n- Minimalistic but uniquely evocative graphics\r\n- Soothing, relaxing atmosphere \r\n- Easy to grasp mechanics with multiple layers of depth\r\n\r\nLogic Path is an innovative puzzle game that\u2019s easy to grasp but offers plenty of depth and challenge at the same time. Its accessibility is enhanced by self-explanatory gameplay and no in-game text. This simplicity combined with a soothing soundtrack makes playing the game a calm, relaxing experience while remaining curious and exciting.\r\n\r\nThroughout the journey across 140 levels Logic Path presents increasingly difficult brain teasers that you can complete at your own leisure. There are no high scores, no challenges, no time limits. You can experiment as much as you like to reach the solution. The game offers plenty of twists, turns and surprises to always keep you interested.\r\n\r\nTo complete all of the challenges you will have to switch your brain into a new line of thinking. Forget what you know about perspective. Unchain your creativity and complete all of the puzzles!",
