		"TBAppDescription": "He was returning from work. On the street it was dark. At one time he had loved the darkness, night, but after meeting with her, everything changed... He was changed. A few more steps and he reached his car. Got into the car, he always remembered that trip on the lake with her. It was a good day, even the best in his life... Insert the key into the ignition switch and tapping his foot on the gas pedal, he went home. One day left without her... He was driving forward, the road was almost invisible, and his state was not very good. He wanted to sleep. His eyes closed themselves. He thought that it would be better to call a taxi... Sudden blow, sound of breaking glass. Pinned down, unable to move. He felt like his life was leaving him. But somehow it seemed to him that this was not the end...\r\n\r\n\r\nTranslations: \r\n\r\n- Chinese (Thanks Yongjun Qin)\r\n- Czech (Thanks Jakub H\u00f6sch)\r\n- Indonesian (Thanks M. Ageng Rizeky)\r\n- Turkish (Thanks Enes Y\u0131\u011f\u0131ngan)\r\n- Portuguese (Thanks Amanda De Oliveira)\r\n- Spanish (Thanks Enzo Zaratee)\r\n\r\nAll Translations:\r\n\r\nEnglish, Spanish, Italian, Chinese, Korean, German, Portuguese, Russian, French, Japanese, Polish, Czech, Hungarian, Slovak, Turkish, Vietnamese, Greek, Swedish, Indonesian, Dutch, Filipino, Ukrainian, Malay, Swahili, Uzbek, Romanian, Kazakh, Finnish, Norwegian, Irish, Arabic, Persian, Urdu, Pashto, Afrikaans, Zulu, Azerbaijani, Bulgarian, Danish, Lithuanian",
