		"TBAppIcon": "https:\/\/img.appvalley.vip\/icon\/1363.png",
		"TBAppDescription": "Subwords is an exciting mix between a trivia and a word game. Words are split into fragments and you have to put them back together as fast as possible. The words in every level are bound to a certain topic, so you have to know about the topic to solve it! But it's no problem if you aren't that familiar with a specific topic: Simply click the bulb to learn something new!\r\n\r\nThe 27 topics not only range from general knowledge like animals and fruits to more specific fields of study like European countries, our solar system or greek mythology. And all of these topics can be played in the classic and in timed mode! \r\n\r\nSubwords will help you learn new concepts improve your spelling skills and may even help you learn German! ",
