		"TBAppId": 294898,
		"TBAppName": "10 Solo",
		"TBAppSlug": "10-solo",
		"TBAppIcon": "https:\/\/img.appvalley.vip\/icon\/1373.png",
		"TBAppDescription": "10 Solo\r\n\r\nA game for every lonely person in the world.\r\n\r\nSwinging man is hanging out the world all by himself, with only one rope holding him up. \r\nAttach him with the one only rope, just like holding up a tiny little hope, never let go. \r\nSwing all the way up, finding a path to the end, where maybe misery and sadness ends. With a bonus probably?\r\n\r\nUnlock the following unknown new worlds and get into new challenges. Obstacles, darkness, loss of gravity, transportals...\r\nFind out what's out there by yourself.\r\n\r\nThis is not an easy game to play, just as life itself. Wandering the whole lifetime\r\nnot knowing where to go? Got confused, sad and lonely? It's time to be by yourself.\r\n\r\nBut do really take a second thought before trying on this game. No one wants to play solo all the time, is there?\r\n\r\n---Beautiful 2D physics.\r\n---9 different worlds to unlock and explore.\r\n---Darkness, transportals, loss of gravity...\r\n---For maximum awesome headphones recommended\r\n---Game Center achievements\r\n---No in-app billing",
		"TBAppUrl": "https:\/\/appv.tweakboxapp.com\/plists\/1359\/install.plist",
