	"TBAppDescription": "This comprehensive app empowers the law-abiding CCW (concealed or open carry permit) holder (or anyone who wants to lawfully transport a firearm in any state.) It gives you direct information needed to follow the maze of arcane, complicated, and dissimilar gun laws in each state and in each situation. Easy-to-use User Interface and Laws & reciprocity updated monthly or more frequently!\n\nJoin the 200,000+ people who have already downloaded the #1 gun reference app on Apple App Store!\n\nKey Features:\n-Instant updates downloaded to your device with the laws change!  Auto-update now available!\n-Individual laws for each state and U.S. territory stored on your phone\n-Updates reciprocity information for each license.\n-State Laws in each category (Transporting Firearms w\/o license, Places Off-Limits for license-holders, State Preemption, Duty to Inform, \"No Guns\" signs Force of Law, New \/ Renewal Licenses, Open Carry, Parking Lot Storage, Magazine & Tactical Rifles, Use of Force & Duty to Retreat, Restaurants Serving Alcohol, Roadside Rest Areas, State & National Parks, State & National Forests, Wildlife Management Areas)\n-Includes Federal Laws, airplane\/train, and Indian Tribal Laws\n-Save your licenses \/ permit info\n-Contact directory of state officials\n-All information available offline (no active internet connection needed)\n-Find laws based on GPS (as well as local points of interest)\n\nApp comes with a free two-year subscription to all law and reciprocity updates.  Additional subscription available at only $.99\/ year.  Auto-renew (charged to iTunes 24 hours before end of subscription) is optional.  \n\nConvenient map to plan your next vacation or interstate-travel to avoid where you cannot carry.  Save your current license or permits (both Resident and Non-Resident) to see which states recognize YOUR permits.  \n\nThis application puts the power in your hands. Access and review the relevant firearm laws and gun prohibitions for every state. Examine the actual gun laws, instead of relying on someone else's interpretation. Find the prohibited locations, transportation rules, permit process, & more for every state! Also provides direct links to the laws themselves on the government websites, so you can research any open questions. It includes the pertinent federal laws. For specific locations (such as restaurants serving alcohol), see the quick allowed status, then click for details and laws. Also includes \"duty to notify\" laws for each state (when available) for contact with a police officer, such as a traffic stop.  \n\nInstant frequent updates to the firearm laws! When new or modified laws are available, it prompts you to download the latest (usually takes only a few seconds). These changes stay with the app and are available offline once downloaded!  Auto-update option available.\n\nCompiled list of links to review information directly from the state governments & law enforcement authorities: State Statutes for each state, direct Reciprocity Information, CCW Application forms, State FAQs, & more. \n\nInteractive state maps show any scenario: All states recognizing a specific permit, all permits that a specific state allows, type of permit available, map of states recognizing your permits. Click on any state to see the detailed laws! \n\nFind and contact (one touch dialing, map to office, email, and URL) local authorities in each state.\n\nAbility to customize and save your preferences (background pictures, high contrast \/ colorblind, etc...).\n\nDisclaimer: If unsure about legality of carrying or transporting in specific location or situation, contact local law enforcement or legal counsel. Laws change frequently and are subject to interpretation. This application implies no warranty and does not constitute legal advice. By using this app, you agree to hold the app authors and owners harmless and without liability. You are responsible for abiding by all laws (official versions held by each state).  Please see full Disclaimer on Developer Website.",
