	"TBAppDescription": "Filter Candy is a collection of powerful film-emulation presets and editing tools. Edit your photos with our presets to transform them into something beautiful. Our extensive collection of presets have something which is ideal for almost any setting or subject. Enhance your photos with editing tools (such as but not limited to vignette, grain, sharpness, exposure, contrast, saturation) and share with loved ones.\n\nIncluded preset packs:\n\nEssential: This pack consists of our most popular and versatile presets\n\nClassic: Vintage-inspired pack recreates the look of days gone by\n\nInstant: Recreate the look of tradition instant film with this pack\n\nSlide: Vivid colors and extreme contrast makes this pack ideal for fashion and outdoors\n\nCreative: Reimagine the boundaries of color with this pack  \n\nBlack: Create a stronger emotional connection with your subject by removing the distraction of color\n\nPhotos by Mark Sebastian",
