		"TBAppDescription": "Theory Lessons features 39 music theory lessons from musictheory.net, presented in their original animated versions.\n\nComplete lesson list:\n\n\u2022 The Staff, Clefs, and Ledger Lines\n\u2022 Note Duration\n\u2022 Measures and Time Signature\n\u2022 Rest Duration\n\u2022 Dots and Ties\n\u2022 Steps and Accidentals\n\n\u2022 Simple and Compound Meter\n\u2022 Odd Meter\n\n\u2022 The Major Scale\n\u2022 The Minor Scales\n\u2022 Scale Degrees\n\u2022 Key Signatures\n\u2022 Key Signature Calculation\n\n\u2022 Generic Intervals\n\u2022 Specific Intervals\n\u2022 Writing Intervals\n\u2022 Interval Inversion\n\n\u2022 Introduction to Chords\n\u2022 Triad Inversion\n\u2022 Seventh Chords\n\u2022 More Seventh Chords\n\u2022 Seventh Chord Inversion\n\n\u2022 Diatonic Triads\n\u2022 Roman Numeral Analysis: Triads\n\u2022 Diatonic Seventh Chords\n\u2022 Roman Numeral Analysis: Seventh Chords\n\u2022 Composing with Minor Scales\n\u2022 Voicing Chords\n\u2022 Analysis: O Canada\n\n\u2022 Nonharmonic Tones\n\u2022 Phrases and Cadences\n\u2022 Circle Progressions\n\u2022 Common Chord Progressions\n\u2022 Triads in First Inversion\n\u2022 Triads in Second Inversion\n\u2022 Analysis: Auld Lang Syne\n\n\u2022 Building Neapolitan Chords\n\u2022 Using Neapolitan Chords\n\u2022 Analysis: Moonlight Sonata",
