		"TBAppDescription": "Get near real-time data from NOAA\/NDBC buoy stations, global sea surface temperatures and  weather forecast provided by coastal and inland stations directly on your iPhone, Apple Watch and iPad! Use Buoy Finder to find all available buoys and plan your sailing\/fishing\/surfing\/boating expedition!\n\nNOAA Buoy Finder a provides instant access to live data transmitted from over 750 buoys scattered throughout North America, Alaska, Hawaii, Canada, Europe, and the Caribbean. Most buoys provide information about current wave heights, wave periods, wind speed, wind direction, air temperature, water temperature, atmospheric pressure, pressure tendency, dew point. \n\n\u25b8 Use marine weather map to find all available buoy stations, once you find the one you want - just tap on it to get detailed readings.\n\u25b8 Save your favorite weather buoys so that you can access them quickly on your iPhone and Apple Watch\n\u25b8 Add buoy station to the list of favorite locations and get details on your iPhone and Apple Watch\n\u25b8 The app works offline, the latest observations will always be accessible for every buoy station\n\u25b8 Using satellite scanner Buoy Finder reports sea surface temperatures (SST) for almost every place in the world.\n\u25b8 Get accurate weather conditions and weather forecast for more than 2,000,000 locations worldwide.\n\u25b8 Buoy stations can be searched using the map, by station ID or using search terms that may describe their location, ie: New Jersey.\n \n\u25b8  Use detailed screens to get all information at a glance\n\u25b8  Use Apple Watch app to get latest observations from buoy or ground station\n\u25b8  Use spotlight to go directly to your favorite locations\n\u25b8  Share your data to Twitter, Facebook, Google+, Instagram and email\n\nOver 750 buoy locations available. \nBuoys are available in the following regions:\n\n\u25b8 East Coast U.S\n\u25b8 West Coast U.S\n\u25b8 Gulf Coast U.S\n\u25b8 Great Lakes U.S\n\u25b8 Hawaii\n\u25b8 Alaska\n\u25b8 Europe\n\u25b8 Canada\n\u25b8 Canadian Maritimes\n\u25b8 Caribbean\n\n\nKey features: \n\n\u25b8  The most complete app for buoy observations\n\u25b8  Near-real time observations from buoys (up to 10 different types of data including current wave heights, wave periods, wind speed, wind direction, air temperature, water temperature, atmospheric pressure, pressure tendency, dew point)\n\u25b8  Global sea surface temperatures\n\u25b8  Current weather conditions for over 2,000,000 locations\n\u25b8  Up to 10-day weather forecast\n\u25b8  Unlimited number of your favorite buoys and surface locations\n\u25b8 Takes full advantage of the new screen sizes (iPhone X\/XS\/XR, iPad PRO and Apple Watch devices)\n\nSpecifications: \n\n\u25b8  Requires iPhone and iPad with iOS 8 and higher, Apple Watch with WatchOS 2 and higher\n\u25b8  Available in 37 languages\n\nThe volume of information reported by buoy station depends on it's construction or other reasons. In case if you don't see wave height, wind speed, or anything else, please understand that it is not the app's limitation. Please feel free to contact us at http:\/\/www.elecont.com with any questions or suggestions.",
