		"TBAppDescription": "LET'S GET BODIED!\nWith these exclusive routines by professional instructor Jenelle Butler, working out has never been easier! Whether you are looking to lose weight, gain weight, increase speed and agility, or improve your diet, J's solutions are now just a tap away! BODIED even includes a one-of-a-kind Pregnancy program and workout routines that is perfect for expecting mothers.\n\nEXPERT ADVICE AND SIMPLE DESIGN\nJ's expert routines have helped thousands of people around the world achieve their goals, and now she's ready to help you! Exercises are simply organized by workout type, making it easy for you to choose routines to get the results you want. Purchase Programs for an exclusive workout routine that can be added to your calendar!\n\nPERSONALIZED ROUTINES\nCreate a profile for quick access to your favorite videos and instantly calculate your BMI by providing basic info such as your birthday and weight. The Bodied calendar helps you track your workout goals and routines, along with premium Challenges you can purchase to guarantee you get the most out of your workout. \n\nNUTRITIONAL VALUE\nNo exercise is complete without a proper diet. J provides you with exclusive tips and resources that you can't find anywhere else. \n\nFRESH CONTENT \nNew videos and resources are uploaded regularly, so make sure you TURN ON NOTIFICATIONS to get the latest deals on J's hottest workout routines.\n\nDeveloped by Winnona Partners, LLC \nwinnonapartners.com",
