		"TBAppDescription": "**** $.99 Limited Time Introductory Price! ****\n\nThe AMA Supercross App offers fans a direct connection to all of the information they need to follow along with the high-flying stars of AMA Supercross, an FIM World Championship. \n\nAMA Supercross, an FIM World Championship, is undisputedly the top Supercross series in the world and draws elite rider talent from every corner of the globe. An international cadre of manufacturers target their best equipment and development teams at these series in the quest for Championship titles.\n\nThe AMA Supercross App features Live Timing & Scoring of all on-track activity, as well as event and season schedules, session results and rider point standings. Rider headshots, bio information and full session laptime data for all riders can be accessed in any active 450SX and 250SX session by clicking on a rider's name on the Live Timing page. The Connect screen features an integrated feed from the official AMA Supercross social media page on Facebook.",
