		"TBAppDescription": "Youtubers Life is the ultimate life simulation\/tycoon videogame. Become the world\u2019s greatest gaming video blogger in history by editing videos, expanding the amount of fans and turning yourself into a billionaire. Create your character \u2014customize it as you wish, there are thousands of hillarous combinations\u2014 and start making your first broadcasts in the cozy room at your parents\u2019 where you grew up since you were little. Record gameplay sessions, buy new and classic consoles, keep an eye on daily tasks, and socialize to increase your popularity while you deal with fans, friends, family and time management!\n\nMake the best gaming videos\nEditing your own videos has never been so immersive! Follow the whole process from A to Z and publish your broadcasts on Internet! Purchase your favourite titles online, get them delivered at home and start recording your gameplay sessions. Improve your videos as you become the greatest video blogger ever! \n\nExperience the real Youtuber's Life!\nBeing a vlogger is not only about recording videos and getting as many views as possible \u2014you also need to cool down and have some fun in your daily life! Go to the cinema to watch the latest film releases, attend presentations of new games, chill out in the club or party in a luxurious yacht! Meet new friends and discover your other half while you keep thinking about the next broadcast you want to make when you get back home.\n\nBecome a famous Celebrity\nThe more viewers you reach the more popular you\u2019ll be! As you become more popular on social media, more VIP\u2019s will be interested in meeting you in person. Important high-tech and gaming brands will contact you and you will eventually meet other famous youtubers. Your fans will battle with all their might to get your autograph!\n\nYoutubers Life is fully translated to English.",
