		"TBAppDescription": "The pastures are green and the day is warm. Shepherd Hazel Woof is grazing her sheep peacefully. What could go wrong on this bright sunny day? Little does she know, her sheep could be ambushed at any moment. Poacher Alex McCunning has been luring her sheep to traps he\u2019s made. Fortunately for Hazel, Alex gets spotted and she can now take action. Will she be able to defend her sheep or will Alex steal them away? \n\nThe fate of the sheep is up to you to decide. Take control of either of the two characters and prepare for a shepherding duel with your opponent.\n\n---\n\nSheeping Around is a multiplayer strategy card game about grazing and stealing sheep. The objective is simple: there's three sheep on the board, and you need to take home or steal two of the three sheep to win.\n\nAs a shepherd attach graze cards to sheep to graze, and when you're done, use \"Whistle\" to take them home. As a thief, attach lure cards to sheep to lure them and when they're lured, use \"Steal\" to steal them away.  But the tricky part is all the other cards that make your opponents' lives harder. You can lay traps, guard sheep, reduce graze \/ lure values and use special bonus cards to your advantage.\n\nAdd deck-building and card collection, and you get the basic elements of a CCG. All in all, an exciting game that will make you ask your friends, \u201cWill you sheep with me?\"\n\n---\n\nKey features:\n\n* Unique, never-seen-before gameplay mechanics in a tragicomic setting.\n* Quick 5-10 minute matches: Play on your commute or on the loo! \n* Smart multiplayer match-making with level based progression. \n* Challenge your friends and ask them to \"sheep\" with you!",
