	"TBAppDescription": "My Koi, number 1 hit on the Mac App Store (Games), is a beautiful and relaxing fish pond app. Customise and name each fish. Feed them daily. Watch them grow. Collect new fish. Escape and relax. \n\nCOLLECT. GROW. NURTURE. ESCAPE.\n\n*********\n\"Love it love it love it - I can't keep my self from checking on them every 3 to 4 hours ... This relaxes me at work.\" 5 stars. - Raulito1991, USA\n\"This was truly my best purchase on the AppStore so far, amazing graphics and gameplay and brilliant for helping me relax\" 5 stars - Joes826482, UK\n\"The best game ever!!!!  - I went into the App Store a few days ago looking for a old koi game I used to play. I instead ended with this and I love it! Worth every cent, this game is so fun. \"  5 Stars. -  Blenore, USA\n\"This app is so beautiful. I love relaxing and watching my koi. I feel like I have koi without all the upkeep. This has quickly become my favorite app!!!\" 5 stars.- Jamelith, USA\n\"First of all you don\u2019t deserve 5 stars you deserve more because this game is just amazing thank you for an amazing game that so life like keep up the good work\" - 5 stars. Florida 696, USA\n\"  If you are seeking out a serene experience, then look no further than My Koi\". - Appaddict.net\n\n**********\n\nWith My Koi you can\n\n*  Add up to 16 unique fish to each pond.  Change their scales and patterns.  No two fish are alike so everyone's experience will be different\n*  Multiple ponds so you can collect more fish. Manage up to 48 fish across 3 ponds.\n*  Customise the pond environment including rocks, plants, substrate and water colour\n*  Unlock more fish slots and new varieties once milestones have been reached\n*  View and track each fish underwater\n*  Feed your fish and watch them swim to food \n*  See your fish grow over time and see their growth stats\n*  Name each fish\n*  Tap them and watch them swim away\n*  View fish happiness levels which will change depending on how much they are fed \n*  The time of day will change as you play effecting sound and light\n*  Enjoy ambient mode (with just the sounds) \n*  Bring the pond to your lounge room via AirPlay and Apple TV\n*  Enjoy the calming atmosphere and beauty of your own private koi pond whilst listening to the relaxing sounds of nature\n\nSo, download My Koi now to escape and relax with your own private underwater oasis.\n\nMy Koi has no in-app purchases or advertising.  \n\nSuitable Platforms: \niPhone 5s\niPhone 6 and 6s\niPhone 7 \niPhone X\niPhone SE\niPad Air 1, 2\niPad Mini 2, 3 and 4\niPad Pro\niPod Touch 6th gen",
