		"TBAppDescription": "Introducing the all-new Steel Guitar 2.0 \u2014 built COMPLETELY from scratch with bigger tone, more soul, and better features than ever!\n\nCombining a large collection of unique guitars, all-new realtime effects and amps processing, and a playing surface more expressive than ever, Steel Guitar is easily the most realistic sounding guitar on iOS.\n\nFor unprecedented control over your tone, expand to 10 unique guitars, 8 iconic virtual-tube amps, and 16 classic effects! Build up your signal chain any way you want, thanks to a simple drag-and-drop interface that accommodates all your amps & FX connections, in any order.\n\nSteel Guitar\u2019s axes range from 6-string electrics to acoustic, 12-string, and to even 8- and 10-string pedals steels. Amps include all the important models of the last 60 years \u2014 each one complete with channel switching, adjustable gain, and EQ. The effects include painstakingly designed virtual-analog overdrives, fuzzes, wah, tape delay, reverbs, and more!\n\nWith the PRO Pack or The Whole Enchilada, gain access to Steel Guitar\u2019s powerful tapedeck complete with recording, looping audio copy\/paste and a plethora of other sharing options; or harness Steel Guitar\u2019s powerful, user-friendly MIDI Learn to control your effects, amps and guitar parameters!\n\nUse MIDI or the accelerometer to control string-bending pedals for authentic pedal steel sounds \u2014 and you can easily configure pedal-to-string assignments via the built-in copedent matrix.\n\nSteel Guitar 2.0 is fully connected, too. With Inter-App Audio and Audiobus available out-of-the box, connect Steel Guitar to your favorite iOS DAW and jam away!\n\nWhether you\u2019re after the soulful ring of acoustic blues, the mean and dirty crunch of Rock, or dreamy bell-like tones of a pedal steel, Steel Guitar has got your covered.\n\n\u2022 Expand to 10 unique guitars, 8 amps and 16 effects\n\u2022 Real time FX & Amps processing\n\u2022 Fully configurable FX & Amps Signal Chain\n\u2022 Virtual-Tube amps including classic American and British models\n\u2022 Virtual-Analog effects: multiple overdrives & fuzzes, reverbs, mods, tape delay & more\n\u2022 All new, easy-to-use guitar interface\n\u2022 Configurable note-snapping, normal & damped sustain\n\u2022 Bar slanting & string dampening gestures\n\u2022 String bending via MIDI or accelerometer-controlled virtual \u201cpedals\u201d\n\u2022 Fully controllable copedent (string-bending pedal map)\n\u2022 Inter App Audio & Audiobus\n\u2022 MIDI Learn & Program Changes*\n\u2022 Tapedeck with recording, audio copy\/paste, looping and lots of other import\/export options*\n\u2022 Save unlimited presets; import\/export presets and folders\n\u2022 Metronome with tap tempo\n\u2022 Left-handed mode\n\n*Included with PRO Pack or The Whole Enchilada",
