		"TBAppDescription": "Spelling Bee by Squeebles is an app aimed at helping 5 to 11 year old kids practice their spellings in a fun, motivating environment. It allows you to set up your own, personalized spelling tests, as well as download from over 150 pre-recorded tests containing over 1800 words.\n\n\"After evaluating many spelling apps, I was so pleasantly surprised while testing out Squeebles Spelling \u2013 it\u2019s a winner!\" - TeachersWithApps.com\n\n**************************************\n\nKey Features (from a parent or teacher's perspective):\n\n- Set up your own custom spelling tests containing the exact words your kids need to learn, recording yourself speaking the audio of each word, or download from over 150 pre-recorded spelling tests created by us across 5 difficulty levels.\n\n- Dyslexia-friendly features, including the option of using Open Dyslexic font.\n\n- Accented characters allow you to set up spelling tests for French, Spanish, German or Italian words.\n\n- Individual statistics cover spelling test scores and show incorrect spellings so you can see what each child is struggling with.\n\n- Print each child's previous tests and answers.\n\n- Register unlimited children on any one device\n\n- Share spelling tests between devices or back them up to the cloud using a free KeyStageFun account.\n\n- Customize each child's experience with personalized settings.\n\n- No in-app purchases, no adverts and no internet links for children to accidentally tap on.\n\n- Parent \/ teacher area can be password protected.\n\n- A motivational reward system for your children keeps them practicing their spellings so they can keep earning further rewards and making progress in the game.\n\n**************************************\n\nKey Features (from a child's perspective):\n\n- Practice your spellings across 4 different game modes, taking personalized tests set by a parent or teacher, KeyStageFun downloadable tests, random tests and tricky tests.\n\n- \"Tricky Words\" mode only asks you questions you previously answered incorrectly.\n\n- Consolidate learning by taking one-off tests that choose words randomly from all the words stored in the app.\n\n- Rescue 20 Squeebles from the clutches of the nasty Spelling Snake, including some designed by children who won our \"Design a Squeeble\" competition. Each Squeeble has its own unique personality, facts and stats.\n\n- Every time you spell a word correctly, you earn turns on the fun \"Squeeberang\" mini game, where Squeebles fly as far as they can through the air on boomerang-shaped colourful flying machines.\n\n- Collect stars to trade for Squeeberangs and power-ups to use in the Squeeberang game. The more stars you have, the better the Squeeberangs you can get.\n\n- Earn power-ups to use in the game.\n\n- View high scores, stats and the rewards you've won.\n\n**************************************\n\nThe app can be used by kids practicing for a weekly spelling test or spelling bee, or those looking to improve vocabulary ahead of school end of year tests.\n\nFrom the App Store:\n\n\"Love this design!  Simple, easy to use, interactive.  I have downloaded eight different spelling apps - all four stars +.  However, this is the best one I have found for my son.\" (5 star review)\n\n\"We use this app to help my daughter study for her weekly spelling test. It is a great study tool. She gets 100% on almost all of her tests.\"\n\n\"My husband and I enjoyed recording our daughter's weekly spelling words (using silly voices, of course!). My nine year old was giggling as she learned - who knew spelling could be so fun?\"\n\n\"My daughter practices her spelling list on this every night. It works great, easy to use and set up. She loves earning points to buy squeeberangs. Way more fun than practicing on paper, and helps them find their way around the keyboard too.\"\n\nIf you have any questions or suggestions for features, please e-mail info@keystagefun.co.uk",
