		"TBAppDescription": "Experience the premium graphics of the new story-driven puzzle mystery. Take on the role of a scientist who risked everything to spy on the aliens that invaded Earth.\n\nPay once, no micro-transactions or ads!  Get the full Returner Zhero \u2013 Final Cut game and play through hours of amazing content.\n\nA stunning 3D tactile space mystery puzzle game. Solve alien puzzles in an immersive sci-fi environment with spectacular graphics. \n\nSOLVE AMAZING PUZZLES\nBrain-teasing and satisfying logic and tactile puzzles that activate and wake up mysterious alien technology\n\nIMMERSIVE GAMEPLAY\nLose yourself in epic alien halls and fantastic environments unlike anything you've ever seen before\n\nCOLLECTIBLE CRYSTALS\nFind crystals aboard the ship and use them to discover the secrets of the past and reveal the possibilities of the future\n\nDYNAMIC SOUND\nListen to the world around you with a soundtrack that changes as you move. Headphones for this game are a must-have!\n\nLIVE ACTION VIDEO\nDiscover the story that led you and Colonel Ling to the alien ship through unique live action videos throughout the game\n\nAI GUIDED\nNever get stuck on a puzzle, and listen to your AI as you explore the ship\n\nSupported Languages: English, Chinese, French, Spanish and German\n\nABOUT THE DEVELOPER\nFantastic, yes is an indie game studio based out of Copenhagen, Denmark\nFind out more at fantasticyes.com and returnerthegame.com\nFollow us on twitter: @fantasticyes3D\n\nCompatible with iPhone 6s\/iPad Air 2 or newer devices\n\nIf you need help or have any questions please send us a message at support@fantasticyes.com\n\nIf you like Returner Zhero try our other standalone adventure in the Returner series, \"Returner 77\" on the App Store",
