		"TBAppDescription": "SPACEPLAN is an experimental piece of interaction based partly on a total misunderstanding of Stephen Hawking\u2019s A Brief History of Time. Use manual clicks and the passage of time to create and launch potato-based devices and probes from your nondescript satellite orbiting a mysterious planet. Unlock the mysteries of the galaxy or just kill some time in what the astrophysics community is calling the \u2018best narrative sci-fi clicker game of all times\u2019.\n\nFEATURES\n\n* Fifteen starchy items to unlock, create, and blast into the vacuum of space.\n\n* Life affirming, silly story that will both captivate and help you kill time.\n\n* Reveal the secrets of five different planets across two different realities.\n\n* Banging soundtrack, as is customary in a narrative sci-fi clicker game.",
