		"TBAppDescription": "High school is now over, and you are preparing for your incoming campus life. You wants to have a tatol transformation before going to the campus.Let's create the new makeup that the world\u2019s never seen before! Head to the salon and create your own style!\n\nFirst, the girl has the opportunity to have a full spa treatment, clean her face, use the exfoliator to perfect skin, trim eyebrows, perform face humidification, apply powder and much more; Next comes the Makeup House where girls can select hairstyle, eye color, while applying eyeliner, eye shadow, blush, and lipstick; After the makeup, comes the Dressup House. Here girls choose her dresses, shoes. Girls can also adorn themselves with earrings, necklace, or barrette. \n\nNow the girl and completely customized to your vision. Her eyes are stunning, her smile is captivating, her hair is fabulous, and it's all just the way you want it. A beautiful princess comes to life. \n\nWhat are you waiting for? Download and enjoy it right away!",
