		"TBAppDescription": "Peppa and George love to play with Polly Parrot and they want you to join them! Fans of the TV show will love this Polly Parrot-inspired app, which encourages pre-schoolers to explore the wonderful world of Peppa through lots of fun filled games, featuring much loved characters, music and sound effects. Create silly sentences for Polly to say, feed her crackers, play hide and seek with her in Peppa\u2019s house and play lots of puzzles like jigsaws and dot to dots!\n\nFeatures\n\n5 x fun-filled games featuring Peppa, George and their family and friends:\n\n\u2022 Create a silly sentence to hear Polly say it\n\u2022 Feed hungry Polly her crackers!\n\u2022 Try to find Polly in Peppa\u2019s house and garden\n\u2022 Match all of the pairs in this puzzle\n\u2022 Join the dots to reveal a picture!\n\nPlus special Polly Parrot content, such as:\n\n\u2022 Sticker rewards\n\nNo adverts, no in-app purchases, just lots of fun with Polly Parrot!\n\nPlease note: This app is not compatible with the iPad 1",
